import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import "./App.css";
import NextTournament from "./components/nextTournament";
import PlayerStats from "./components/playerStats";

function App() {
  return (
    <div className="App">

      <nav className="navbar navbar-expand navbar-dark bg-dark">
        <a href="/golf/tournaments" className="navbar-brand">
          StatsBull
        </a>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/golf"} className="nav-link">
              Tournament
            </Link>
          </li>

          <li className="nav-item">
            <Link to={"/golf/stats"} className="nav-link">
              Golfers
            </Link>
          </li>
        </div>
      </nav>

      <h1>Welcome to React Router!</h1>

      <Routes>
        <Route path="/golf" element={<NextTournament />} />
        <Route path="/golf/stats" element={<PlayerStats />} />
      </Routes>

    </div>

  );
}

export default App;
